import React from "react";
import Epoch from "./Epoch";
import ComparisonChart from "./ComparisonChart";
import { Box } from "@chakra-ui/react";

function Home(){
    return (
      <Box
        maxH={1000}
        bg="Gifs/background.gif"
        bgSize="cover"
        bgPosition="center"
        h="100vh"
        w="100vw"
      >
        <Epoch />
        <ComparisonChart />
      </Box>
    );
}

export default Home;
